// Adiciona ouvintes de evento aos botões relevantes
document.getElementById('add-guest-button').addEventListener('click', addGuestFields);
document.getElementById('add-reservation-button').addEventListener('click', addReservation);
document.getElementById('generate-pdf-button').addEventListener('click', generatePDF);



function formatDate(inputDate) {
    const date = new Date(inputDate + 'T00:00:00');
    if (isNaN(date)) {
        return "Data inválida";
    }

    const options = { year: 'numeric', month: 'long', day: '2-digit' };

    // Configurando o fuso horário para 'pt-BR'
    const ptBRDate = new Intl.DateTimeFormat('pt-BR', options).format(date);
    return ptBRDate;
}

function showNotification() {
    var notification = document.getElementById("notification");
    notification.classList.remove("hidden");

    setTimeout(function () {
        notification.classList.add("hidden");
    }, 3000); // Oculta o balão após 3 segundos
}

function showNotification2() {
    var notification = document.getElementById("notification2");
    notification.classList.remove("hidden");

    setTimeout(function () {
        notification.classList.add("hidden");
    }, 3000); // Oculta o balão após 3 segundos
}




const inputDate = '2023-10-29';
console.log(formatDate(inputDate));

// Variáveis globais
let guestName = "";
const reservations = [];

// Função para adicionar campos de hóspedes adicionais
function addGuestFields() {
    const additionalGuestsContainer = document.getElementById("additional-guests");

    const guestNameInput = document.createElement("input");
    guestNameInput.type = "text";
    guestNameInput.placeholder = "Nome do Hóspede";
    guestNameInput.required = true;
    guestNameInput.className = "guest-name";

    const documentInput = document.createElement("input");
    documentInput.type = "text";
    documentInput.placeholder = "Documento";
    documentInput.required = true;
    documentInput.className = "guest-document";

    additionalGuestsContainer.appendChild(guestNameInput);
    additionalGuestsContainer.appendChild(documentInput);
}

// Função para adicionar uma reserva
function addReservation() {
    const hotelName = document.getElementById("hotel-name").value;
    const checkIn = formatDate(document.getElementById("check-in").value);
    const checkOut = formatDate(document.getElementById("check-out").value);
    const roomTypeElement = document.getElementById("roomType");
    const roomType = roomTypeElement.value || "Não especificado";


    if (!hotelName || !checkIn || !checkOut) {
        showNotification();
        return;
    }

    const amenities = [];
    document.querySelectorAll('input[type="checkbox"]').forEach(checkbox => {
        if (checkbox.checked) {
            amenities.push(checkbox.nextElementSibling.textContent.trim());
        }
    });

    const doc = document.getElementById("document").value;
    const guestName = document.getElementById("guest-name").value;

    const guestList = [];

    if (guestName && doc) {
        guestList.push(`${guestName} - Documento: ${doc}`);
    }

    const additionalGuestNames = document.querySelectorAll('.guest-name');
    const additionalGuestDocuments = document.querySelectorAll('.guest-document');

    additionalGuestNames.forEach((guestNameField, index) => {
        const guestName = guestNameField.value;
        const guestDocument = additionalGuestDocuments[index].value;

        if (guestName && guestDocument) {
            guestList.push(`${guestName} - Documento: ${guestDocument}`);
        }
    });

    const reservation = {
        hotelName,
        checkIn,
        checkOut,
        amenities,
        roomType,
        guests: guestList,
    };

    reservations.push(reservation);
    displayReservations();
}

// Função para resetar o formulário
function resetForm() {
    document.getElementById("hotel-name").value = "";
    document.getElementById("check-in").value = "";
    document.getElementById("check-out").value = "";

    document.querySelectorAll('input[type="checkbox"]').forEach(checkbox => {
        checkbox.checked = false;
    });

    document.querySelector('input[name="roomType"]:checked')?.removeAttribute("checked");
}

// Função para exibir as reservas adicionadas
function displayReservations() {
    const reservationsContainer = document.getElementById("reservations");
    reservationsContainer.innerHTML = "";

    reservations.forEach((reservation, index) => {
        const reservationDiv = document.createElement("div");
        reservationDiv.className = "reservation-entry";
        reservationDiv.innerHTML = `
            <h2>Reserva ${index + 1}</h2>
            <p><strong>Hotel:</strong> ${reservation.hotelName}</p>
            <p><strong>Data de Entrada:</strong> ${reservation.checkIn}</p>
            <p><strong>Data de Saída:</strong> ${reservation.checkOut}</p>
            <p><strong>Comodidades:</strong> ${reservation.amenities.join(", ")}</p>
            <p><strong>Tipo de Quarto:</strong> ${reservation.roomType}</p>
            <p><strong>Hóspedes:</strong></p>
        `;

        if (reservation.guests.length > 0) {
            reservation.guests.forEach((guest, guestIndex) => {
                reservationDiv.innerHTML += `
                    <p>${guestIndex + 1}. ${guest}</p>
                `;
            });
        } else {
            reservationDiv.innerHTML += `<p>Nenhum hóspede adicionado.</p>`;
        }

        reservationsContainer.appendChild(reservationDiv);
    });
}

const watermark = 'data:image/png;base64,';

function hasReservations() {
    return reservations.length > 0;
}
// Função para gerar PDF com base no display na tela
function generatePDF() {
    {

        if (hasReservations()) {
            // Se houver pelo menos uma reserva, gere o PDF
            // ...


            // Carregue a imagem da logo no formato base64
            const headerLogoBase64 = 'data:image/png;base64,'; // Substitua pelo seu base64

            const docDefinition = {
                content: [],
                footer: {
                    columns: [
                        {
                            table: {
                                widths: [100, '*', '*'],
                                body: [
                                    [
                                        {
                                            image: 'data:image/png;base64,',
                                            width: 80,
                                            alignment: 'left',
                                            margin: [5, 0],
                                        },
                                        { text: 'AgroCP Indústria e Comércio de Fertilizantes', alignment: 'center', color: '#666', fontSize: 8 },
                                        { text: 'Avenida Caio de Brito, 1505 - Santana, Três Pontas, Minas Gerais, 37190-000', alignment: 'center', color: '#666', fontSize: 8 },
                                    ]
                                ]
                            },
                            layout: 'noBorders'
                        }
                    ]
                },
                background: function (currentPage) {
                    // Adicione a marca d'água (logo) a todas as páginas
                    return [
                        {
                            image: watermark, // Use o logo em formato base64
                            width: 700, // Ajuste o tamanho da marca d'água
                            margin: [10, 200], // Centralize a marca d'água na página
                            opacity: 0.7 // Defina o nível de transparência (0 a 1, onde 0 é totalmente transparente)

                        }
                    ];
                },
                styles: {
                    header: {
                        fontSize: 20,
                        bold: true,
                        margin: [0, 10, 0, 10],
                        alignment: 'center',
                        background: '#fff', // Alterado para cor de fundo branca (ou a cor desejada)
                        color: '#000', // Alterado para a cor do texto desejada
                        border: [false, false, false, 2],
                    },
                    subheader: {
                        fontSize: 14,
                        bold: true,
                        margin: [0, 10, 0, 5],
                        background: '#f9f9f9',
                        border: [false, false, false, 1],
                    },
                    text: {
                        fontSize: 12,
                        margin: [0, 0, 0, 5],
                    },
                    footerText: {
                        fontSize: 10,
                        bold: true,
                        margin: [0, 10, 0, 10],
                        alignment: 'center',
                        color: '#666',
                    },
                },
                defaultStyle: {
                    color: '#333',
                },
            };

            reservations.forEach((reservation, index) => {
                // Inclua a imagem da logo no cabeçalho
                docDefinition.content.push({ image: headerLogoBase64, width: 100, alignment: 'center' });

                docDefinition.content.push(
                    { text: 'Ficha de Reserva AgroCP', style: 'header' },
                    { text: `Reserva ${index + 1}`, style: 'subheader' },
                    { text: `Nome do Hotel: ${reservation.hotelName}`, style: 'text' },
                    { text: `Data de Entrada: ${reservation.checkIn}`, style: 'text' },
                    { text: `Data de Saída: ${reservation.checkOut}`, style: 'text' },
                    { text: `Comodidades: ${reservation.amenities.join(", ")}`, style: 'text' },
                    { text: `Tipo de Quarto: ${reservation.roomType}`, style: 'text' },
                    { text: 'Hóspedes:', style: 'subheader' }
                );

                reservation.guests.forEach((guest, guestIndex) => {
                    docDefinition.content.push({ text: `${guestIndex + 1}. ${guest}`, style: 'text' });
                });

                if (index < reservations.length - 1) {
                    docDefinition.content.push({ text: ' ', pageBreak: 'before' });
                }
            });

            docDefinition.content.push(
                { text: 'QUALQUER ALTERAÇÃO OU CANCELAMENTO NA RESERVA SERÁ FORMALIZADA COM ANTECEDÊNCIA', style: 'footerText' }
            );


            pdfMake.createPdf(docDefinition).download('ficha_de_reserva.pdf');
        } else {
            // Se não houver reservas, emita um alerta
            showNotification2();
        }
    }
    resetForm();
}














